import React, { FC, useContext, useEffect, useState } from "react";
import LoginForm from "./components/LoginForm";
import { Context } from "./index";
import { observer } from "mobx-react-lite";
import { IUser } from "./models/IUser";
import UserService from "./services/UserService";
import "./App.css";
import {
  BrowserRouter,
  NavLink,
  Navigate,
  Route,
  Routes,
  useParams,
  useMatch,
} from "react-router-dom";

const App: FC = () => {
  const routes = useRoutes([
    {
        path: "/",
        element: <MainPage />,
    },
    {
        path: "users",
        element: <UsersLayout />,
        children: [
            { index: true, element: <UserListPage /> },
            {
                path: ":userId",
                element: <Outlet />,
                children: [
                    { path: "profile", element: <UserProfilePage /> },
                    { path: "edit", element: <EditUserPage /> },
                    { index: true, element: <Navigate to='./profile' /> },
                    { path: "*", element: <Navigate to='../profile' /> },
                ],
            },
        ],
    },
    { path: "*", element: <Navigate to='/' /> },
]);
return (
    <div className='App'>
        <h1> App Layout</h1>
        <NavLink to='/users'>Users list Page</NavLink>
        {routes}
    </div>
);
};

function MainPage() {
  return <h1>MainPage</h1>;
}
function UsersLayout() {
  const { path } = useMatch();
  return (
    <div>
      <h1>Users Layout</h1>
      <NavLink to="/">Main Page</NavLink>
      <Switch>
        <Route path={path + "/:userId/profile"} component={UserProfilePage} />
        <Route path={path + "/:userId/edit"} component={EditUserPage} />
        <Route path={path} exact component={UserListPage} />
        <Redirect from={path + "/:userId"} to={path + "/:userId/profile"} />
      </Switch>
    </div>
  );
}
function UserListPage() {
  const { path } = useRouteMatch();
  return (
    <div>
      <h1> User List Page</h1>
      <ul>
        {new Array(5).fill("").map((_, index) => (
          <li key={"user_list_component_" + index}>
            <NavLink to={`${path}/${index}`}>User {index}</NavLink>
          </li>
        ))}
      </ul>
    </div>
  );
}
function UserProfilePage() {
  const { userId } = useParams();
  return (
    <div>
      <h1>UserPage</h1>
      <ul>
        <li>
          <NavLink to="/users">Users List page</NavLink>
        </li>
        <li>
          <NavLink to={`/users/${userId}/edit`}>Edit this user</NavLink>
        </li>
      </ul>
      <p> userId:{userId}</p>
    </div>
  );
}
function EditUserPage() {
  const { userId } = useParams();
  return (
    <div>
      <h1>Edit User Page</h1>
      <ul>
        <li>
          <NavLink to={"/users/" + userId}>User profile Page</NavLink>
        </li>
        <li>
          <NavLink to={"/users/" + (+userId + 1)}> Another User</NavLink>
        </li>
        <li>
          <NavLink to={"/users"}> Users List page</NavLink>
        </li>
      </ul>
    </div>
  );
}
export default observer(App); // observer для отслеживания статуса
